Stickman Archer is an action PvP battle game where you can fight with other stickmen and prove you're the best. Enter a world of stickman and discover all the easter eggs. Use different bows and arrows, improve your skills and win every duel. Become the champion and prove that you're the great archer.
Improve your bow, arrows, quiver, and shield. Unlock new bonus arrows along with new skills and effects. Customize your stickman character with multiple hats, masks, hairstyles, beards and animations to create a unique appearance. Unlock new stickers for the stickman's flag. Create your bowman and show them how it should be.

Key features:
➽ Amazing graphics;
➽ Lots of unique maps;
➽ Easy to handle;
➽ Online battles;
➽ Great animation and realistic actions;
➽ Level up and equip yourself with different bows and arrows for better results;
➽ Customize your stickman.

Instagram: https://www.instagram.com/stickman_archer.byril/

Welcome to the Venezuelan political arena!

The struggle for power was and remains the main purpose and occupation of many Venezuelan politicians. The methods of their political struggle acquire the most desperate forms.

Parliamentary elections are approaching, during which the leading representatives of political parties will meet in a tense battle. All Venezuela froze in anticipation of a struggle in which the stronger will win. Only one will win - the strongest one, who will be able to protect his beliefs and lead the government of our country.

It will be the one who will receive all the levers of influence and from whom will depend the internal and external policies of Venezuela. On the way to the prime minister's chair, you will have a hard and thorny way: you will have to compete with the most influential and famous politicians.

Good luck in your fight!

Features of the game:
• 16 characters created on the basis of real Venezuelan politicians and public persons;
• unique combat ability of each character; 
• live audio phrases of real politicians;
• various gaming locations;
• available campaign mode and fast combat option;
• record statistics: fight with friends in the fast game passing!
